import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
import Axios from 'axios'




function App() {

  const [usernameReg, setUsernameReg] = useState("")
  const [passwordReg, setPasswordReg] = useState("")
  const [roleReg, setRoleReg] = useState("")
  const [fullnameReg, setFullNameReg] = useState("")
  const [username, setUsername] = useState("")
  const [password, setPassword] = useState("")


  const register = () => {
    console.log('Worked')
    Axios.post('http://localhost:3001/register', {
      username: usernameReg,
      password: passwordReg, 
      fullname: fullnameReg,
      role: roleReg
    }).then((response) => {
      console.log(response)
    })
  }



  const login = () => {
    console.log('Worked')
    Axios.post('http://localhost:3001/login', {
      username: username,
      password: password, 
    }).then((response) => {
      console.log(response)
    })
  }


  return (
    <div className="App">
      <div className="registration">
        <h1>Registration</h1><br></br>
        <label>Full name</label><br></br>
        <input type="text" onChange={(e) => {setFullNameReg(e.target.value)}}/><br></br>
        <label>Username</label><br></br>
        <input type="text" onChange={(e) => {setUsernameReg(e.target.value)}}/><br></br>
        <label>Password</label><br></br>
        <input type="text" onChange={(e) => {setPasswordReg(e.target.value)}}/><br></br>
        <br></br>
        <label>Role</label><br></br>
        <br></br>
        <label>Client</label>
        <input type="radio" onClick={(e) => {console.log(e.target.value); setRoleReg(e.target.value)}} name="Role" value="Client"/><br></br>
        <label>Manager</label>
        <input type="radio" onChange={(e) => {setRoleReg(e.target.value)}} name="Role" value="Manager"/><br></br>
        <button onClick={register}>Register</button><br></br>
      </div>
      <div className="login">
        <h1>Login</h1><br></br>
        <input type="text" placeholder="Username..." onChange={(e) => {setUsername(e.target.value)}}/><br></br>
        <br></br>
        <input type="password" placeholder="Password..." onChange={(e) => {setPassword(e.target.value)}} /><br></br>
        <br></br>
        <button onClick={login}>Log in</button>
      </div>
    </div>
  );
}

export default App;
